responses.body:
[
   {
      "headerName":"#",
      "minWidth":60,
      "width":60,
      "checkboxSelection":true,
      "sortable":false,
      "suppressMenu":true,
      "pinned":true
   },
   {
      "headerName":"Employee",
      "headerGroupComponentFramework":{
         "_custom":{
            "type":"function",
            "display":"<span>f</span> VueComponent(options)",
            "_reviveId":29722
         }
      },
      "children":[
         {
            "headerName":"Name",
            "field":"name",
            "width":150,
            "pinned":true
         },
         {
            "headerName":"Country",
            "field":"country",
            "width":150,
            "cellRenderer":{
               "_custom":{
                  "type":"function",
                  "display":"<span>f</span> countryCellRenderer(params)",
                  "_reviveId":29723
               }
            },
            "pinned":true,
            "filterParams":{
               "cellRenderer":{
                  "_custom":{
                     "type":"function",
                     "display":"<span>f</span> countryCellRenderer(params)",
                     "_reviveId":29724
                  }
               },
               "cellHeight":20
            }
         },
         {
            "headerName":"DOB",
            "field":"dob",
            "width":120,
            "pinned":true,
            "cellRenderer":{
               "_custom":{
                  "type":"function",
                  "display":"<span>f</span> cellRenderer(params)",
                  "_reviveId":29725
               }
            },
            "filter":"agDateColumnFilter",
            "columnGroupShow":"open"
         }
      ]
   },
   {
      "headerName":"IT Skills",
      "children":[
         {
            "headerName":"Skills",
            "width":125,
            "sortable":false,
            "cellRenderer":{
               "_custom":{
                  "type":"function",
                  "display":"<span>f</span> skillsCellRenderer(params)",
                  "_reviveId":29726
               }
            },
            "filter":{
               "_custom":{
                  "type":"function",
                  "display":"<span>f</span> SkillFilter()",
                  "_reviveId":29727
               }
            }
         },
         {
            "headerName":"Proficiency",
            "field":"proficiency",
            "width":120,
            "cellRenderer":{
               "_custom":{
                  "type":"function",
                  "display":"<span>f</span> percentCellRenderer(params)",
                  "_reviveId":29728
               }
            },
            "filter":{
               "_custom":{
                  "type":"function",
                  "display":"<span>f</span> ProficiencyFilter()",
                  "_reviveId":29729
               }
            }
         }
      ]
   },
   {
      "headerName":"Contact",
      "children":[
         {
            "headerName":"Mobile",
            "field":"mobile",
            "width":150,
            "filter":"text"
         },
         {
            "headerName":"Land-line",
            "field":"landline",
            "width":150,
            "filter":"text"
         },
         {
            "headerName":"Address",
            "field":"address",
            "width":500,
            "filter":"text"
         }
